import React from 'react';
import styled from 'styled-components';
import logo from '../pictures/head.png';

const Styles = styled.div`

background: #eeeeee;
height: 30vh;


`

function Footer() {
  return (
    <Styles>
      <img
        className="d-block w-25"
        src={logo}
        alt="logo"
      />

    </Styles>
  );



}

export default Footer;
